import { useState } from "react";
import axios from "axios";
import "./Style.css";

function CreateRecipe() {
  const [name, setName] = useState("");
  const [summary, setSummary] = useState("");
  const [healthScore, setHealthScore] = useState("");
  const [step, setStep] = useState("");
  const [ingedients, setIngredients] = useState([]);
  const [equipment, setEquipment] = useState([]);
  const [image, setImage] = useState("");
  const [diets, setDiets] = useState([]);

  function handleChangeName(e) {
    setName(e.target.value);
  }

  function handleChangeSummary(e) {
    setSummary(e.target.value);
  }

  function handleChangeHealthScore(e) {
    setHealthScore(e.target.value);
    if (e.targer.value > 100) setHealthScore("100");
    if (e.target.value < 0) setHealthScore("0");
    else setHealthScore(String(e.targe.value));
  }

  function handleChangeStep(e) {
    setStep(e.target.value);
  }

  function handleChangeIngredients(e) {
    setIngredients(e.target.value);
  }

  function handleChangeEquipment(e) {
    setEquipment(e.target.value);
  }

  function handleChangeImage(e) {
    setImage(e.target.value);
  }

  function handleCheckbox(e) {
    setDiets(e.target.value);
  }

  function handleSubmit(e) {
    e.preventDefault();
    if (name === "" || summary === "") return;

    if (image === "")
      setImage(
        "https://www.food4fuel.com/wp-content/uploads/woocommerce-placeholder-600x600.png"
      );

    axios
      .post("http://localhost:3001/recipes", {
        name: name,
        summary: summary,
        healthScore: healthScore,
        analyzedInstructions: [
          {
            steps: [
              { step: step, ingredients: ingedients, equipment: equipment },
            ],
          },
        ],
        image: image,
        diets: diets,
      })
      .then((response) => console.log(response))
      .catch((err) => console.log(err));
  }

  return (
    <div className="boxCreate">
      <div className="cardCreate">
        <div className="order">
          <>
            <h3>Name</h3>
            <input type="text" onChange={handleChangeName} />
          </>
          <>
            <h3>Summary</h3>
            <input type="text" onChange={handleChangeSummary} />
          </>
          <>
            <h3>Health Score</h3>
            <input
              type="number"
              value={Number(healthScore)}
              onChange={handleChangeHealthScore}
            />
          </>
          <>
            <h3>Steps</h3>
            <input type="text" onChange={handleChangeStep} />
          </>
          <>
            <h3>Ingredients</h3>
            <input type="text" onChange={handleChangeIngredients} />
          </>
          <>
            <h3>Equipment Needed</h3>
            <input type="text" onChange={handleChangeEquipment} />
          </>
          <>
            <h3>Image</h3>
            <input type="text" onChange={handleChangeImage} />
          </>
          <>
            <h3>Diets</h3>
            <div>
              <>Gluten Free</>
              <input
                type="checkbox"
                name="diets"
                value="Gluten Free"
                onChange={handleCheckbox}
              />
              <>Dairy Free</>
              <input
                type="checkbox"
                name="diets"
                value="Dairy Free"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Ketogenic"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Vegetarian"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Lacto-Vegetarian"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Ovo-Vegetarian"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Vegan"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Pescetarian"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Paleo"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Primal"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="low FODMAP"
                onChange={handleCheckbox}
              />
              <input
                type="checkbox"
                name="diets"
                value="Whole30"
                onChange={handleCheckbox}
              />
            </div>
          </>
          <button onSubmit={handleSubmit}>Create New Recipe</button>
        </div>
      </div>
    </div>
  );
}

export default CreateRecipe;
